      if (f > 0) {
        (lastarr.substring(0, f + 1), lastarr.substring(f))
      } else {
        ("", "")
      }
    def doMapm(x: String) = {
      val startIdx = x.indexOf("$component=\"");
      val endIdx = x.indexOf("\"", startIdx + "$component=\"".length());
      if (endIdx > startIdx && startIdx > 0) {
        val name = x.substring(startIdx + "$component=\"".length(), endIdx);
        if (name.endsWith("$")) {
          scalamap.put(name, x)
        } else {
          javamap.put(name, x);
        }
      }
    }
    (arr.dropRight(1)).map(doMapm)
    doMapm(lastinstance);

